		lineWidth: 0.1,

		renderSectionDetail: function(doc, docY, docH, currentY, sectionRenderer) {
			var self = this;
			
			doc.doit = false;
			
			var sectionY = currentY;
			if( sectionRenderer(sectionY) > (docY +  docH)) {
				sectionY = docY;
				doc.addPage();
			}
			
			doc.doit = true;
			
			return sectionRenderer(sectionY);
		},

		printPDF: function (context, onSuccess, onError) {
			var self = this;
			self.delegateEvents();
			try {
				self.renderDetail( context, onSuccess );
			} catch ( err ) {
				onError(err);
			}
		},
		
